import React, { useState } from "react";
import { signIn } from "state/firebaseFunctions";
import { useHistory } from "react-router-dom";
import {
  StyleSheet,
  View,
  Image,
  Text,
  ImageBackground,
  Modal,
  TouchableOpacity,
} from "react-native";
import { Feather } from "@expo/vector-icons";

function Login() {
  const [email, setEmail] = useState();
  const [password, setPassword] = useState();
  const [error, seterror] = useState(false);
  const history = useHistory();

  const attemptSignIn = () => {
    if (email && password) {
      signIn(email, password).catch((error) => {
        console.log(error);
        seterror(error.message);
      });
    }
  };

  return (
    <ImageBackground
      style={styles.container}
      source={require("./images/background.png")}
      imageStyle={{
        resizeMode: "cover",
      }}
    >
      <View style={styles.mainPageContainer}>
        <View style={styles.topContainer}>
          <View style={styles.headerContainer}>
            <View style={styles.headerInnerContainer}>
              <a
                href="https://divinepos.com"
                style={{ textDecoration: "none" }}
              >
                <View style={styles.backBtn}>
                  <Feather name="arrow-left" style={styles.leftIcon} />
                  <Text style={styles.backTxt}>Back</Text>
                </View>
              </a>
              <a
                href="https://divinepos.com"
                style={{ textDecoration: "none" }}
              >
                <Image
                  source={require("assets/dpos-logo-black.png")}
                  resizeMode="contain"
                  style={styles.logo}
                />
              </a>
            </View>
          </View>
          <View style={styles.logInContainer}>
            <Text style={styles.logIn}>Log In</Text>
            <View style={styles.bottomContainer}>
              <View style={styles.inputsContainer}>
                <View style={styles.emailInputGroup}>
                  <Text style={styles.emailAddress}>Email address</Text>
                  <View style={styles.emailInput}></View>
                </View>
                <View style={styles.passwordInputGroup}>
                  <Text style={styles.password}>Password</Text>
                  <View style={styles.passwordInput}></View>
                </View>
              </View>
              <View style={styles.btnBottomContainer}>
                <TouchableOpacity style={styles.loginBtn}>
                  <Text style={styles.loginTxt}>Log In</Text>
                </TouchableOpacity>
                <TouchableOpacity onPress={() => history.push("/sign-up")}>
                  <Text style={styles.signUpTxt}>
                    Don't have an account? Sign Up
                  </Text>
                </TouchableOpacity>
                <TouchableOpacity
                  onPress={() => history.push("/reset-password")}
                >
                  <Text style={styles.forgotPassword}>Forgot password</Text>
                </TouchableOpacity>
              </View>
            </View>
          </View>
        </View>
      </View>
    </ImageBackground>
  );
}

